import React from 'react'

function Navbar() {
<Container>
  <Navbar expand="lg" variant="light" bg="light">
    <Container>
      <Navbar.Brand href="#">Navbar</Navbar.Brand>
    </Container>
  </Navbar>
</Container>
  return(
    Navbar()
    )

  
}

export default Navbar;
